const inputClick = () => console.log("Cklicked");
const mouseDver = () => console.log("Mouse over");

const helpText = "Hello world";
const elements = (
  <div>
    <h1>{helpText}</h1>
    <input
      placeholder={helpText}
      onClick={inputClick}
      onMouseEnter={mouseDver}
    />
    <p>{helpText === "Hello world" ? "Yes" : "No"}</p>
  </div>
);
const app = document.getElementById("app");

ReactDOM.render(elements, app);
